        arr.append([int(x) for x in stdin.strip().split()])
    for row in arr:
        row.sort()

    def permute(start, end):
        if start >= end:
            return [[arr[i][j] for j in range(len(arr))] for i in range(len(arr))]
        else:
            for i in range(start, end):
                # swap elements
                arr[i], arr[start] = arr[start], arr[i]
                # permute from start + 1 to end
                permute(start + 1, end)
                # undo swap
                arr[i], arr[start] = arr[start], arr[i]
    permute(0, n)
