    for i in range(n):
        x, y = list(map(int, stdin.strip().split()))
        points.append((x, y))

    points.sort(key=lambda p: max(p), reverse=True)

    def distance(p1, p2):
        return abs(p1[0] - p2[0]) + abs(p1[1] - p2[1])

    def dp(d, p, points):
        if p == len(points) - 1:
            return d
        else:
            p1 = points[p]
            p2 = points[p + 1]
            if distance(p1, p2) == 1:
                return d + distance(p1, p2)
            else:
                return min(
                    dp(d + distance(p1, p2), p + 1, points) + 1,
                    dp(d + 1, p + 1, points) + 1,
                )

    return str(dp(0, 0, points))

